import React from 'react'
import SearchBox from './components/SearchBox'
import {BrownserRouter as Router, Switch, Route} from 'react-router-dom' 
import MovieCard from './components/MovieCard'


function App() {
  return (
    <Router>
    <div className="App">
      <h1> Movie Search </h1>

      <div>
       <SearchBox/>
       <Route path='/moviecard' component={MovieCard}/>
 /
      </div>

    </div>
    </Router>
  );
}

export default App;
